        public string RemoverQuebrasDeLinha(string input)
        {
            string resultado = input.Replace("\\r", string.Empty);
            resultado = resultado.Replace("\\n", string.Empty);
            resultado = resultado.Replace("\\r\\n", string.Empty);
            resultado = resultado.Replace("\\", string.Empty);
            return resultado;
        }

        public string AdicionarKAntesDeTil(string input)
        {
            int contador = 0;

            //a'b'c'd'e'f}'g'h'i'j'k'l'm'n'o'p'q'r's't'u'v'x'y'w'z
            //123456
            for (int i = 0; i < input.Length; i++)
            {
                char t = input[i];

                if (t.ToString().Equals("\'"))
                {
                    contador++;
                }
                if (contador == 6)
                {
                    input = input.Insert(i, "}");
                    i++;
                    contador = 0;
                }
            }

            //foreach (char item in input)
            //{
            //    if(item.ToString().Equals("\'"))
            //    {
            //        contador++;
            //    }
            //    if(contador == 6)
            //    {
            //        input.Replace("\'", "}\'");
            //        contador = 0;
            //    }
            //}

            return input;
        }


